import React from 'react';
import { Link } from '@reach/router';

const ArticleCard = ({ title, body, key, topic }) => {
  return (
    <li>
      <Link to={`${topic}/${key}`}>
        <h4>{title}</h4>
      </Link>
      <p>{body}</p>
    </li>
  );
};

export default ArticleCard;
